【エマルジョンリムーバーの詳細】<br>
●余分な皮脂やメイク残りを、さらっと除去！ これで毛穴悩みを解消。生まれたての肌へ。<br>
●毛穴の黒ずみが目立つ原因の1つは皮脂汚れ。 さらに毛穴の奥に詰まったメイクやクレンジング剤の汚れが拍車をかけています。 実はこれらの汚れは洗顔ではなかなか落とせないのです。 エマルジョンリムーバーはこの両方の汚れに作用し、負担なく浮かして落とす事が出来ます。<br><br>

【使用方法】<br>
●朝、化粧する前に4-5回程スプレーしてティッシュで拭き取るだけ。余分な皮脂を除去し、その後の化粧ののりを良くし、ファンデーションがよれる事も防ぎます。化粧持ちが変わります。<br>
●メイクを落とした後、洗顔する前に5-10回程スプレーしてください。メイク落としや洗顔だけでは完全に除去できない、化粧残りや皮脂の汚れを浮かし出し、毛穴の黒ずみやくすみを防ぎます。<br>
●日中の顔のベタつきにはシュッと一振り。毛穴の奥の汚れた皮脂が浮き出てスッキリ！また、軽くティッシュなどに染み込ませ、加齢臭の原因である耳の後ろを拭く事により毛穴を清潔に保て、加齢臭の予防にも効果的です。<br><br>

【ご注意】<br>
○高温多湿を避け冷暗所に保管してください。<br>
○海水に天然成分を含んでいますのでまれに白く濁る場合がありますが、品質上問題はありません。<br>
○お肌に異常が生じていないかよく注意してご使用ください。お肌に合わないときはご使用をおやめください。<br>
○本品は天然成分配合のため、色が変色する場合がありますが、品質上問題ありません。<br><br>

【成分】<br>
水、海水、アルギニン、フィチン酸、酸化銀<br><br>

【内容量】<br>
200ml<br><br>
日本製<br>
<br>
